import React, { useRef, useState } from "react";
import { uploadAndRun, fetchFile } from "./api";
import PipelineTabs from "./components/PipelineTabs";
import FloatingBackground from "./components/FloatingBackground";
import LandingPage from "./components/LandingPage";

function App() {
  const [showLanding, setShowLanding] = useState(true);
  const fileInput = useRef();
  const [file, setFile] = useState(null);
  const [status, setStatus] = useState("Idle");
  const [notebook, setNotebook] = useState("");
  const [readme, setReadme] = useState("");
  const [notebookPath, setNotebookPath] = useState("");
  const [readmePath, setReadmePath] = useState("");

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
    setNotebook("");
    setReadme("");
    setStatus("Idle");
  };

  const handleRemoveFile = () => {
    setFile(null);
    setNotebook("");
    setReadme("");
    setStatus("Idle");
    if (fileInput.current) fileInput.current.value = "";
  };

  const handleUploadAndRun = async () => {
    setStatus("Processing...");
    try {
      const res = await uploadAndRun(file);
      setNotebookPath(res.notebook);
      setReadmePath(res.readme);
      const [nb, rd] = await Promise.all([
        fetchFile(res.notebook),
        fetchFile(res.readme),
      ]);
      setNotebook(nb);
      setReadme(rd);
      setStatus("Done!");
    } catch (err) {
      setStatus("Error: " + err.message);
    }
  };

  const handleDownload = (type) => {
    const path = type === "notebook" ? notebookPath : readmePath;
    window.open(`http://localhost:8000/${path}`, "_blank");
  };

  if (showLanding) {
    return <LandingPage onStart={() => setShowLanding(false)} />;
  }

  return (
    <div style={{
      position: "relative",
      minHeight: "100vh",
      background: "#22272e",
      overflow: "hidden"
    }}>
      <FloatingBackground />
      <div style={{
        maxWidth: 700,
        margin: "40px auto",
        background: "#181b20",
        border: "1px solid #23272e",
        borderRadius: 8,
        boxShadow: "0 2px 8px rgba(0,0,0,0.16)",
        padding: 32,
        color: "#adbac7",
        position: "relative",
        zIndex: 1
      }}>
        <h2 style={{ fontWeight: 700, color: "#cdd9e5", background: "#101216", padding: "12px 0 12px 16px", borderRadius: 6, marginBottom: 28, letterSpacing: 1 }}>AI Data Science Pipeline</h2>
        <div style={{ marginBottom: 24, display: "flex", alignItems: "center" }}>
          <input
            type="file"
            accept=".csv"
            ref={fileInput}
            style={{ display: "none" }}
            onChange={handleFileChange}
          />
          <input
            type="text"
            value={file ? file.name : ""}
            placeholder="No file chosen"
            readOnly
            style={{
              flex: 1,
              background: "#23272e",
              color: "#adbac7",
              border: "1px solid #444c56",
              borderRadius: 4,
              padding: "10px 12px",
              marginRight: 12,
              fontSize: 16,
              outline: "none"
            }}
          />
          {!file && (
            <button
              onClick={() => fileInput.current.click()}
              style={{
                background: "#2d333b",
                color: "#adbac7",
                border: "1px solid #444c56",
                padding: "10px 24px",
                borderRadius: 6,
                fontWeight: 600,
                cursor: "pointer",
                marginRight: 0
              }}
            >
              Choose CSV File
            </button>
          )}
          {file && (
            <>
              <button
                onClick={handleUploadAndRun}
                style={{
                  background: "#347d39",
                  color: "#fff",
                  border: "none",
                  padding: "10px 24px",
                  borderRadius: 6,
                  fontWeight: 600,
                  cursor: "pointer",
                  marginRight: 8
                }}
              >
                Upload & Run
              </button>
              <button
                onClick={handleRemoveFile}
                style={{
                  background: "transparent",
                  color: "#f47067",
                  border: "none",
                  fontSize: 22,
                  cursor: "pointer",
                  lineHeight: 1,
                  marginLeft: 4
                }}
                title="Remove file"
              >
                &times;
              </button>
            </>
          )}
        </div>
        <div style={{ marginBottom: 16, color: status.startsWith("Error") ? "#f47067" : "#768390" }}>Status: {status}</div>
        {(notebook || readme) && (
          <PipelineTabs
            notebook={notebook}
            readme={readme}
            onDownload={handleDownload}
            darkMode={true}
          />
        )}
      </div>
    </div>
  );
}

export default App;
